  // Validation function for numbers
  validateNumber(value, attribute) {
    const parsedValue = parseFloat(value);
    if (isNaN(parsedValue) || typeof parsedValue !== 'number') {
      throw new TypeError(`${attribute} must be a number`);
    }
    return parsedValue;
  }
}

